import {Link} from 'react-router-dom';
import {Stack,Image,Grid,GridItem,Box} from '@chakra-ui/react';

const link = [
    {
        to:"/",
        title:"Home"
    },
    {
        to:"/Meal-Deals",
        title:"Meal Deals"
    },
    {
        to:"/KindMoments",
        title:"KindMoments"
    },
    {
        to:"/Hot-Picks",
        title:"Hot Picks"
    },
    {
        to:"/Recipes",
        title:"Recipes"
    },
    {
        to:"/Directory",
        title:"Directory"
    },
    {
        to:"/Articles",
        title:"Articles"
    },
    {
        to:"/Help",
        title:"Help"
    }
]
function Navbar(){
    return(
        <Stack>
            <Box display="flex" flexDirection="row">
                <Box>
                    <Image src="https://www.kindmeal.my/images/logo-kindmeal.png"/>
                </Box>
                <Box display="flex">
                    <Box></Box>
                </Box>
                <Box></Box>
            </Box>
            <Box></Box>
        </Stack>
    )
}

export default Navbar;
